import React from 'react';

function Food() {
  return <h1>I like Potato</h1>
}

function App() {
  return (
    <div>
      <h1>Hello!!!!!</h1>
      <Food fav="kimchi" something={true} papapa={["hello", 1, 2, 3, 4, true]}/>
    </div>
  );
}

export default App;
